  water depth and temperaturendata. The cruise was conducted by Fleet Numerical Oceanography
  Centern(FNOC), Monterey, CA using ship Paul. The bathythermograph (XBT) datanwas
  collected between January 12, 1990 and February 12, 1990 as part ofnIntegrated Global
  Ocean Service System (IGOSS) project. The data werensent from the cruise ship to
  the National Ocean Service, Rockville, MDnvia telecommunication. This data containing
  3,025 observations wasnsubmitted by Mr. Paul Stevens and is offline on January 24,
  2005 whennthis abstract was written. Please check the actual file format when datanbecomes
  available on line before uploading this abstract.\",\n\t\"license_title\": null,\n\t\"extras\":
